import React from 'react'
import { createStackNavigator } from '@react-navigation/stack';
import Signin from 'modules/Screens/auth/Signin';
import Signup from 'modules/Screens/auth/Signup';
import ForgotPassword from 'modules/Screens/auth/ForgotPassword';
import ChangePassword from 'modules/Screens/auth/ChangePassword';

const Stack = createStackNavigator();

const Authentication = () => {
    return (
        <>
            <Stack.Navigator>
                <Stack.Screen name="signin" component={Signin} />
                <Stack.Screen name="signup" component={Signup} />
                <Stack.Screen name="forgotpassword" component={ForgotPassword} />
                <Stack.Screen name="changepassword" component={ChangePassword} />
            </Stack.Navigator>
        </>
    )
}

export default Authentication
